import {
  BrowserRouter,
  Navigate,
  Route,
  Routes,
  useNavigate,
} from "react-router-dom";
import HomePage from "./homePage/HomePage";
import Login from "./login/Login";

function App() {
  const token = localStorage.getItem("accessToken");
  const checkToken = (token: any) => {
    return token ? <HomePage /> : <Navigate to={"/login"} />;
  };
  // check ri là sai 
  // lúc chạy app thì nó chạy cái route rồi 
  return (
    <BrowserRouter>
      <Routes>
        {/* check ở đây, check  */}
        <Route path="/login" Component={Login} />
        <Route path="/HomePage" element={checkToken(token)} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
